;; **
;;; ## Data
;; **

;; @@
(require 'htm-mnist.core :reload)

(defn mnist-inputs
  [images-file labels-file xform n]
  (map (fn [img lab]
         {:image (xform img)
          :label lab})
       (this/read-mnist-images images-file n)
       (this/read-mnist-labels labels-file)))

(defn fg-indices
  [image]
  (keep-indexed (fn [i pixval]
                  (when (>= pixval 64) i))
                image))

(defn train-inputs
  [xform n]
  (mnist-inputs "public/data/train-images-idx3-ubyte"
                "public/data/train-labels-idx1-ubyte"
                xform n))

(defn test-inputs
  [xform n]
  (mnist-inputs "public/data/test-images-idx3-ubyte"
                "public/data/test-labels-idx1-ubyte"
                xform n))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/test-inputs</span>"}
