;; **
;;; ## HTM model
;; **

;; @@
(def spec
  {:column-dimensions [1000]
   :global-inhibition? true
   :depth 1
   :lateral-synapses? false
   :distal {:learn? false}
   :proximal {:perm-inc 0.01
              :perm-dec 0.01}})

;; input will be like {:image [on bits...], :label 7}

(def model (core/regions-in-series
            1 core/sensory-region
            (repeat spec) {:input [:image image-encoder]}))

(time
  (def trained-1k
    (reduce p/htm-step model (train-inputs fg-indices 1000))))


