;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/trained-1k</span>"}
;; <=

;; **
;;; ### Receptive fields
;; **

;; @@
(let [lyr (get-in trained-1k [:regions :rgn-0 :layer-3])]
  (for [col (range 20)]
    (let [inbits (keys (core/cells-proximal-bit-votes lyr [[col 0]]))]
      (viz image-encoder inbits))))
