  (frequencies (map second results30k)))

(def confusion30k
  (frequencies results30k))

[

["actual"
 (plot/bar-chart (range 10) (map hist-actual (range 10))
                 :plot-size 240)
 ]

["guessed"
 (plot/bar-chart (range 10) (map hist-guessed (range 10))
                 :plot-size 240)
 ]

(table-view
  (for [actual (range 10)]
    (into
      [actual]
      (for [guessed (range 10)]
        (get confusion30k [actual guessed]))))
    :columns (into ['_] (range 10)))

["error rate:"
 (let [n (reduce + (vals confusion30k))
       nok (reduce + (vals (select-keys confusion30k (map vector (range 10) (range 10)))))]
   [(- n nok) "/" n])
 ]
  
]
